import { AcceptButton } from "./AcceptButton.js"
import { DenyButton } from "./DenyButton.js"
import { Link } from "react-router-dom"
import { PendingButtons } from "./PendingButtons"

export const AcceptDenyContainer = ({ requests, id }) => {

  if (requests.isPending) { 
    return <PendingButtons requests={requests} id={id}/> 
  } else if (requests.isAccepted) { 
    return <AcceptButton /> 
  } else if (requests.isDenied) { 
    return <DenyButton /> 
  }
}
